INSERT INTO `phone_mail_messages` (`id`, `recipient`, `sender`, `subject`, `content`, `attachments`, `actions`, `read`, `timestamp`) VALUES
	('432oA', 'Antonio0@gmail.com', 'lscustoms@gmail.com', 'Re: recrutement ls customs', '', NULL, NULL, 1, '2024-04-23 20:19:59'),
	('46K6h', 'lscustoms@gmail.com', 'martinezBen@gmail.com', 'CV', 'prenom:Martinez\nNom: Ben\n\n\n\n\nJe suis un passionné d\'automobile avec une expertise avérée dans la personnalisation et la modification de véhicules. Mon objectif est de mettre mes compétences techniques et ma passion au service de LS Customs pour contribuer à fournir des services de qualité exceptionnelle à la clientèle.\n\nmes compétence : \n\n\nConnaissance approfondie des tendances du marché et des dernières technologies en matière de personnalisation de véhicules.\nCompétences avancées en design et en modélisation 3D pour la conception de pièces sur mesure.\nFortes aptitudes en gestion de projet, avec une capacité démontrée à respecter les délais et les budgets.\nEsprit d\'équipe et excellentes compétences en communication pour collaborer efficacement avec les clients et les collègues.\nvoile je vous fait ce mini CV pour rejoindre le LS Custome j\'espère que vous me accepterais merci et à l\'équipe de LS Custom \n\nMOTIVATION: \nje suis tres motiver pour vous rejoindre , vous aider a fair repartire les client satisfait j\'ai voulu travailler au LS Custom depuis petite mon père tenez la même entreprise en france et pour lui rendre hommage j\'aimerais vous rejoindre \n', NULL, NULL, 1, '2024-04-22 16:30:05'),
	('52XzW', 'lscustoms@gmail.com', 'Antonio0@gmail.com', 'recrutement', 'bojour HRP je m\'appelle ethan j\'ai 14 ans horaires lundi 17h30 22h00 mardi 17h30 22h00 mercredi 13h15 22h00 jeudi 17h30 22h00 vendredi 17h30  23h00 samedi 10h00 23h00 dimanche 10h00 22h  presantation rp Antonio Suarez 24 ans motivation j\'aiùerai pouvoir vous rejoindre dans le ls customs car j\'adore tout ce qui et automobile j\'aime bien etre avec des gens etre en relation avec eu les aider leur faire des customs  des reparation  je suis tres motive a presue travaillez tous le temps dans plusieurs ville j\'etait mecano chef d\'equipe a l\'coute respecteux et gentil', NULL, NULL, 1, '2024-04-23 20:46:42'),
	('57oR1', 'lscustoms@gmail.com', 'alexissanchez@gmail.com', 'Re: Re: Re: Re: CV', 'Pas de soucis j\'y serait \n', NULL, NULL, 1, '2024-04-23 18:01:15'),
	('5w7Nv', 'AlvaroRicardo@gmail.com', 'lscustoms@gmail.com', 'Re: job mécano', 'Bonsoir , Alvaro Ricardo nous vous informons que votre Cv a bien été pris en compte je suis vous laisse me contacter sur la radio D ( .Inkorreckt ) \n', NULL, NULL, 1, '2024-04-22 17:23:13'),
	('64bXb', 'lscustoms@gmail.com', 'Antonio0@gmail.com', 'recrutement ls customs', 'HRP je m\'apelle ethan j\'ai 14 ans RPj\'ai deja etait mecano dans d\'autres villes 3 qualites gentil a l\'ecoute patient 3 defaut nerveux mefiant timide  Motivation je suis motive a travaillez ici car ces un metier de reve la haut comme en ville je serais tres investi Mais horaires lundi 17h30 22h00 mardi 17h30 22h 00 mercredi 13h00 22h jeudi 17h30 22h vendredi 17h30 23h00 samedi 10h00 23hh00     ', NULL, NULL, 1, '2024-04-23 20:16:14'),
	('69VuA', 'lscustoms@gmail.com', 'alexissanchez@gmail.com', 'Re: Re: CV', 'Pas de problème merci d\'avance \n', NULL, NULL, 1, '2024-04-23 17:17:59'),
	('6x644', 'lscustoms@gmail.com', 'AlvaroRicardo@gmail.com', 'canditatures mécano', 'Bonsoir sénor je voulais travailler comme mécano chez vous je peut etre disponible toute la journée, j\'ai beaucoup d expérience et je peut faire de belles customs véhicule je peut etre dispo quand vous voulez pour plus d\'information désoler pour mon ortograp', NULL, NULL, 1, '2024-04-22 16:19:29'),
	('85147', 'lscustoms@gmail.com', 'alexissanchez@gmail.com', 'CV', 'Bonjour,  HRP   Prenom: Alexis   AGE : 15 ans   DISPONIBILITÉ: je suis disponible une semaine sur deux  les jours de la semaine ou je suis présent   RP Prenom: Alexis   Nom: Sanchez   Age:24 ans   Motivation :Je m’appelle Alexis Sanchez, j’aimerais pouvoir rejoindre le LS Custom car je suis un fan auto, J\'aime énormément être en relation avec les client et de  pouvoir les aider au quotidien  en réparant leur véhicule. je suis quelqu\'un de  motivé et je suis prêt a travailler pendant plusieurs heures. \nDans une autre ville j\'ai déjà était mécano donc je connais quelque base il faudrait comme meme que je revois quelque petie chose \nje suis quelqu\'un de mature a l\'ecoute et respectueux', NULL, NULL, 1, '2024-04-23 17:09:16'),
	('9bQH8', 'lscustoms@gmail.com', 'alexissanchez@gmail.com', 'Re: Re: Re: Re: Re: CV', 'Petite question avec l\'anonce des papilon par rapport a la soirée de se soir es que le rendez vous et toujours présent ou aller vous a la soirée car moi je n\'y vais pas donc je suis toujours dispo pour le rdv \n', NULL, NULL, 1, '2024-04-23 18:26:29'),
	('9V92Q', 'martinezBen@gmail.com', 'lscustoms@gmail.com', 'Re: CV', 'Bonjours \n\nMonsieur Martinez Ben , notre équipe Los Santos Customs a bien reçue votre CV nous vous donnons rendez-vous au Los Santos Customs le 22 Avril a 19:00 .\n\nCordialement LS Customs', NULL, NULL, 1, '2024-04-22 16:39:09'),
	('C3I8W', 'alexissanchez@gmail.com', 'lscustoms@gmail.com', 'Re: CV', 'Bonjours Alexis Sanchez notre équipe a bien reçue votre CV , nous vous recontacterons dans un futur proche .\n\nL\'équipe Los Santos Customs \nzd', NULL, NULL, 1, '2024-04-23 17:11:59'),
	('L59vZ', 'lscustoms@gmail.com', 'martinezBen@gmail.com', 'Re: Re: CV', 'je suis au LS CUSTOME VOUS ME AVEZ DIT A 21H\n', NULL, NULL, 1, '2024-04-22 19:13:14'),
	('ms7VS', 'lscustoms@gmail.com', 'alexissanchez@gmail.com', 'Re: Re: CV', 'Bonsoir,\nJe voulais savoir si vous aviez étudier mon CV ? Merci d\'avance bonne  soiree.\n\n\n\nAlexis Sanchez', NULL, NULL, 1, '2024-04-23 17:59:48'),
	('n3N1w', 'lscustoms@gmail.com', 'Antonio0@gmail.com', 'recrutement ls custom', 'hrp je m\'appelle Ethan j\'ai 14 ans j\'ai deja fait de la mechanic dans d\'autre ville rp je m\'appelle Antonio Suarez et apres je preferer fair un entretien oral et me poser les question car je n\'ai pas trop d\'idee', NULL, NULL, 1, '2024-04-23 18:27:40'),
	('Q6sw7', 'lscustoms@gmail.com', 'kendrickespinoza@gmail.com', ' test ', 'dqdqzdqdqdqd', NULL, NULL, 1, '2024-04-22 15:24:57'),
	('Re1v5', 'alexissanchez@gmail.com', 'lscustoms@gmail.com', 'Re: Re: Re: CV', 'je vous donne rendez vous a 21:00 au ls customs !\n', NULL, NULL, 1, '2024-04-23 18:00:42'),
	('wqOGu', 'lscustoms@gmail.com', 'adam45@gmail.com', 'mon cv pour le ls custom', 'PRENOM ADAM NOM BENAOUDA\nAGE 23 an \nje veux etre  dans le ls custom pour avoir de largent est reparer les voiture ', NULL, NULL, 1, '2024-04-22 16:38:34'),
	('x3whv', 'lscustoms@gmail.com', 'AlvaroRicardo@gmail.com', 'job mécano', 'Prénom: Alvaro\nNom: Ricardo\n\nmes compétence:  esprit d équipe et tres courtois je connais fort bien la mécanique de pointe surtout pour les customs de véhicule je connais la technologie européen pour les véhicule de type Brabus et je peut conseiller les citoyens pour faire la plus belle customs égale argent pour l\'entreprise j\'aime bien le conctact et je peut etre la a n\'importe quelle heure pour vous senor.\n\nMotivation:  je veut que chaque citoyen américo soi fiere de ls custom on sortant de votre cher enteprise, et nous faire partie de lélite de la ville et surtout rejoindre votre famille qui est pour moi la best de ville !', NULL, NULL, 1, '2024-04-22 16:47:19'),
	('Yj2vp', 'adam45@gmail.com', 'lscustoms@gmail.com', 'Re: mon cv pour le ls custom', 'Refuser trop court ', NULL, NULL, 1, '2024-04-23 10:44:48');
